import React from 'react';

function CalendarIcon() {
  return (
    <svg
      xmlns='http://www.w3.org/2000/svg'
      width='0.938vw'
      height='0.938vw'
      fill='none'
      viewBox='0 0 18 18'
    >
      <path
        stroke='#828282'
        strokeLinecap='round'
        strokeLinejoin='round'
        d='M13.5 3h-9a3 3 0 00-3 3v7.5a3 3 0 003 3h9a3 3 0 003-3V6a3 3 0 00-3-3zM1.5 7.5h15M6 1.5v3-3zm6 0v3-3z'
      ></path>
    </svg>
  );
}

export default CalendarIcon;
